import React, { Component } from "react";

class Name extends Component {
  constructor(props) {
    this.state = {
      nameValue: "lll"
    };
  }
  componentWillReceiveProps() {
    this.setState({
      nameValue: "aaa"
    });
  }

  render() {
    console.log(this.state.nameValue);
    return <input type="text" value={this.props.nameValue} />;
  }
}

export default Name;
